      out.write("        <div class=\"container text-center\">\r\n");
      out.write("            <h2 class=\"section-title\">技术介绍</h2>\r\n");
      out.write("            <div class=\"item\">\r\n");
      out.write("                <h3 class=\"item-title\">等离子体灭菌</h3>\r\n");
      out.write("                <div class=\"item-meta\">Posted 1 day ago</div>\r\n");
      out.write("                <div class=\"item-content\">\r\n");
      out.write("                    <p>等离子体灭菌作用机理</p>\r\n");
      out.write("\r\n");
      out.write("                    <ul class=\"text-left\">\r\n");
      out.write("                        <li class=\"\"><p>活性基团的作用：等离子体中含有的大量活性氧离子、高能自由基团等成分，极易与细菌、霉菌及芽孢、病毒中蛋白质和核酸物质发生氧化反应而变性，使各类微 生物死亡。</p></li>\r\n");
      out.write("                        <li class=\"\"><p>高速粒子击穿作用：在灭菌实验后，通过电镜观察经等离子体作用后的细菌菌体与病毒颗粒图像，均呈现千疮百孔状，这是由具有高动能的电子和离子产生的击穿 蚀刻效应所致。</p></li>\r\n");
      out.write("                        <li class=\"\"><p>紫外线的作用：在激发H2O2形成等离子体的过程中，伴随有部分紫外线产生，这种高能紫外光子被微生物或病毒中蛋白质所吸收，致使其分子变性失活。</p></li>\r\n");
      out.write("                    </ul><!--//nav-->\r\n");
      out.write("\r\n");
      out.write("                    <div class=\"img-holder center-block\">\r\n");
      out.write("                        <img class=\"img-responsive\" src=\"img/product/update-3.jpg\" alt=\"\">\r\n");
      out.write("                    </div>\r\n");
      out.write("                </div><!--//item-content-->\r\n");
      out.write("            </div><!--//item-->\r\n");
      out.write("            <div class=\"item\">\r\n");
      out.write("                <h3 class=\"item-title\">等离子体灭菌的应用</h3>\r\n");
      out.write("                <div class=\"item-meta\">Posted 23 days ago</div>\r\n");
      out.write("                <div class=\"item-content text-left\">\r\n");
      out.write("                    <p>在医疗领域应用的等离子体灭菌技术于20世纪80年代始于美国，Menashi等首先提出卤素类气体等离子体具有很强的杀菌作用，可用于非耐热医疗器 械的快速灭菌，低温等离子体灭菌技术1987年获得专利。美国强生公司研制的Starrad 100S过氧化氢等离子体灭菌器，于1997年经FDA批准上市。现已在欧美、日本等发达国家医疗机构微创手术中广泛使用。2004年开始在我国推广宣 传，已有几十家大型医疗单位开始使用。由此也使得等离子体低温灭菌技术在我国医疗领域的使用得到广泛的认同。</p>\r\n");
      out.write("                    <div class=\"img-holder center-block\">\r\n");
      out.write("                        <img class=\"img-responsive\" src=\"img/product/update-1.jpg\" alt=\"\">\r\n");
      out.write("                    </div>\r\n");
      out.write("                </div><!--//item-content-->\r\n");
      out.write("            </div><!--//item-->\r\n");
      out.write("            <div class=\"item\">\r\n");
      out.write("                <h3 class=\"item-title\">等离子体灭菌的特点</h3>\r\n");
      out.write("                <div class=\"item-meta\">Posted 1 month ago</div>\r\n");
      out.write("                <div class=\"item-content\">\r\n");
      out.write("                    <ul class=\"text-left\">\r\n");
      out.write("                        <li class=\"\"><p>环保：以临床常用的双氧水为介质，经射频电磁场激发形成低温等离子体并完成灭菌，其最终产物是少量水蒸汽和氧气，无毒物残留与排出，对医务人员无损害，对 环境无污染。</p></li>\r\n");
      out.write("                        <li class=\"\"><p>安全：采用自动控制触板，易操作，无需高温、高压，且安装和调试简单，使用安全。</p></li>\r\n");
      out.write("                        <li class=\"\"><p>常温：灭菌温度为35℃～45℃，干性灭菌，对器械和物品无损害，可延长贵重器械使用寿命。</p></li>\r\n");
      out.write("                        <li class=\"\"><p>省时：灭菌周期短，可在30～50分钟的时间内完成简单器械灭菌，在50～70分钟内完成复杂器械的灭菌，操作完成后可直接使用，无需象高温灭菌后要自然 冷却放置，也不象环氧乙烷低温灭菌后需要放置6～48小时通风扩散，以降低环氧乙烷的残留浓度。</p></li>\r\n");
      out.write("                        <li class=\"\"><p>适用范围广：低温灭菌适用于多种材料器械，尤其对非耐热电子器械如内窥镜、电子仪器、电池、导线、摄影照相机等物品的灭菌处理，独具优势。</p></li>\r\n");
      out.write("\t\t\t\t</ul>\r\n");
